Caption:
Recently, we were invited to @isha.foundation to have a retreat with @sadhguru .

The invitation itself was surprising and unimaginable for me. Because in the tech niche, only I was the one who was invited despite there are many other big names in the industry, I'm blessed ☺️.

These 3 days were full of joy and ecstasy. We met many creators, exchanged our ideas and thoughts. 

@thecyberzeel joined us like brothers. Despite 1M, his humbleness was evident through his words. We discussed a few things on spirituality, it was all fun with you brother.

@ca_rachanaranade mam gave wonderful session on fundamentals of finance to the students of @ishahomeschool . I also got some clarity over those fundamentals. We were able to easily sync with her and her husband, maybe because we are punekars now.🤪

@manukagram_ is the best volunteer from @isha.foundation you can have. More than a friend, just like a brother 🙏. 
@param._.jaiswal thanks for being my videographer for the event. 

